CREATE TABLE `producteditrecords` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `proid` int(10) NOT NULL DEFAULT '0',
  `MinPurchase` int(10) NOT NULL DEFAULT '0',
  `OrderStep` int(10) NOT NULL DEFAULT '0',
  `IsHit` int(10) NOT NULL DEFAULT '0',
  `MarketPrice` decimal(18,0) NOT NULL DEFAULT '0',
  `BalancePrice` decimal(18,0) NOT NULL DEFAULT '0',
  `MemberPrice` decimal(18,0) NOT NULL DEFAULT '0',
  `VipPrice` decimal(18,0) NOT NULL DEFAULT '0',
  `Rebates` decimal(18,0) NOT NULL DEFAULT '0',
  `DeducePv` decimal(18,0) NOT NULL DEFAULT '0',
  `FristAdvertising` decimal(18,0) NOT NULL DEFAULT '0',
  `RepeatAdvertising` decimal(18,0) NOT NULL DEFAULT '0',
  `ExchangePv` decimal(18,0) NOT NULL DEFAULT '0',
  `SalesPv` decimal(18,0) NOT NULL DEFAULT '0',
  `admin` varchar(50) NOT NULL DEFAULT '',
  `adddate` datetime NOT NULL,
  `keywords` varchar(200) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='商品信息编辑记录表';
