CREATE TABLE `productstock` (
  `StyleId` int(10) NOT NULL AUTO_INCREMENT COMMENT '规格ID',
  `ProId` int(10) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `SupplierId` int(10) NOT NULL DEFAULT '0' COMMENT '供货商ID',
  `Txm` varchar(200) NOT NULL DEFAULT '' COMMENT '条形码',
  `StyleName` varchar(100) NOT NULL DEFAULT '' COMMENT '规格名称',
  `ProColor` varchar(100) NOT NULL DEFAULT '' COMMENT '商品颜色',
  `Kucun` int(10) NOT NULL DEFAULT '0' COMMENT '库存',
  `KucunWeifahuo` int(10) NOT NULL DEFAULT '0' COMMENT '库存未发货',
  `IsDisplay` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否显示 0否 1是',
  `AddDate` datetime DEFAULT NULL COMMENT '添加时间',
  `PositionCode` varchar(20) NOT NULL DEFAULT '' COMMENT '货位编号',
  `CansunKucun` int(10) NOT NULL DEFAULT '0' COMMENT '残损库存',
  `remark` longtext,
  `kucunWeifukuan` int(10) NOT NULL DEFAULT '0',
  `StyleName1` varchar(60) NOT NULL DEFAULT '',
  `goods_id` int(10) NOT NULL COMMENT '久零商品id',
  `spec_id` int(10) NOT NULL COMMENT '久零商品规格id',
  `voucher_price` decimal(18,0) NOT NULL DEFAULT '0' COMMENT '久零网价格',
  `ModifyDate` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`StyleId`)
) ENGINE=MyISAM AUTO_INCREMENT=6337 DEFAULT CHARSET=utf8 COMMENT='商品规格库存表';
