--
-- Table structure for table `shoppingcart`
--

DROP TABLE IF EXISTS `shoppingcart`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `shoppingcart` (
  `Id` int(10) NOT NULL AUTO_INCREMENT,
  `SupId` int(10) NOT NULL DEFAULT '0' COMMENT '供应商编号',
  `SupName` varchar(50) NOT NULL DEFAULT '' COMMENT '供应商名称',
  `ProId` int(10) NOT NULL DEFAULT '0' COMMENT '商品编号',
  `ProName` varchar(50) NOT NULL DEFAULT '' COMMENT '商品名称',
  `StyleId` int(10) NOT NULL DEFAULT '0' COMMENT '样式Id',
  `StyleName` varchar(50) NOT NULL DEFAULT '' COMMENT '样式名称',
  `ProNum` int(10) NOT NULL DEFAULT '0' COMMENT '商品数量',
  `ShopPrice` decimal(18,2) NOT NULL DEFAULT '0.00' COMMENT '购买价',
  `ConsumeIntegral` decimal(18,2) NOT NULL DEFAULT '0.00' COMMENT '购买此商品消耗的积分',
  `GiveIntegral` decimal(18,2) NOT NULL DEFAULT '0.00' COMMENT '购买此商品赠送的积分',
  `Unit` varchar(50) NOT NULL DEFAULT '' COMMENT '单位',
  `CartType` int(10) NOT NULL DEFAULT '0' COMMENT '购物车类型',
  `PositionCode` varchar(20) NOT NULL DEFAULT '' COMMENT '货位编号',
  `Agentd` varchar(50) NOT NULL DEFAULT '' COMMENT '会员编号',
  `AddTime` datetime NOT NULL COMMENT '商品添加至购物车的时间',
  `BalancePrice` decimal(18,0) NOT NULL DEFAULT '0' COMMENT '商品的结算价',
  `RegionOfBuy` varchar(100) NOT NULL DEFAULT '' COMMENT '此商品时从哪儿点击加入购物车的',
  `status` tinyint(2) NOT NULL DEFAULT '1',
  `is_pode` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开启上传身份证：0不开启1开启',
